	this.dowork=true;
	this.apos=false;
	this.aft=false;
	this.go=function(start=false)
	{
		if(start||this.apos===false)
		{ // это старт
			this.dowork=true;
			this.aft=$('table#freecoins_table')[0];
			this.apos=this.aft.rows.length-1;
			this.res=[];
			console.log('start',this.aft,this.apos);
		} else
		if(this.apos===0)
		{
		// это остановка
			this.apos=false;
			console.log('ok');
		}
		// продолжаем
		for(var cnt=10;cnt>0;cnt--) if(this.aft.rows[this.apos])
		{
		var name=this.aft.rows[this.apos].cells[0].innerText.toLowerCase();
		var amount=new Number(this.aft.rows[this.apos].cells[1].innerText);
		var get=this.aft.rows[this.apos].cells[2].innerText;

		if(get=='готово'||get=='ready')
		{
			if(!this.res[name]) this.res[name]=amount;else this.res[name]+=amount;
		}
		if(this.rur[name]||this.btc[name]||this.doge[name])
		{
			var rp=Math.max(
				this.rur[name]?amount*this.rur[name]:0,
				this.btc[name]?amount*this.btc[name]*this.rur['btc']:0,
				this.doge[name]?amount*this.doge[name]*this.rur['doge']:0
			);
			if(get!='ready'||rp<0.0001)
			{
				this.aft.rows[this.apos].style.display="none";
				this.aft.deleteRow(this.apos);
			} else
			{
				var it=this.aft.rows[this.apos].cells[3].querySelectorAll('input')[1];
				it.value=rp.toFixed(8)+' цена:'+new Number(this.rur[name]).toFixed(8)+' р.';
				it.style.width='200px';
			}
		}
		if(this.apos%50==0) console.log((100*(1-this.apos/(this.aft.rows.length-1))).toFixed(2),'%');
		//console.log(this.apos,'/',this.aft.rows.length-1);
		this.apos--;

		}
		if(this.dowork) setTimeout(function(){fc.go();},100);
	}
